tweet:
Just my take, but Covid without social media would have been:

*more isolating and more insulated;

*more lonely and less polarising;

*less informed and less confused;

*more private and less prescriptive;

*less connected and more neighbourly;

*less social and more civil.

We have lost more than 55,000 lives for COVID-19 in the UK - A world class, well developed &amp; instrumented health care has failed in large in this 21st century.

Who is responsible for this failure?

